import Quote from './Quote';

const Quotation = () => {
    return (
        <div class="appStyle">
            <Quote name="Albert Einstein" text="&quot;Imagination is more important than knowleddge.&quot;" count={10} />
            <Quote name="Nike" text="&quot;Just do it&quot;" count={40} />
            <Quote name="Albus Dumbledore" text="&quot;It takes a great deal of bravery to stand up to our enemies,  but just as much to stand up to our friends.&quot;" count={20} />
            <Quote name="(Disney's) Rapunzel" text="&quot;Step outside of your comfort zone, for that's where life truly begins.&quot;" count={24} />
        </div>
    );
}

export default Quotation;
